    let test_name = "ultra-complex_func10_pass22";
    let ts_svg_path = "tests/fixtures/ion-examples/ts-ultra-complex-func10-pass22.svg";
    let json_path = "ion-examples/ultra-complex.json";

    // Read TypeScript fixture
    let ts_svg = fs::read_to_string(ts_svg_path)
        .expect(&format!("Failed to read TS fixture: {}", ts_svg_path));

    // Parse JSON and generate Rust SVG
    let json_str = fs::read_to_string(json_path)
        .expect(&format!("Failed to read JSON: {}", json_path));
    let ion_json: IonJSON = serde_json::from_str(&json_str)
        .expect("Failed to parse JSON");

